import React, { useEffect, useState } from 'react';
import CardComp from './CardComp';
import Item from './Item';

export default () => {
  const [data, setData] = useState(
    fetch('http://localhost:5000/buscar?plt=hbm&gnr=act,cmy')
      .then((res) => res.json())
      .then((res) => console.log('data: ', res[1].node.content.title))
      .then((res) => setData(res)),
  );

  useEffect(() => {
    fetch('http://localhost:5000/buscar?plt=hbm&gnr=act,cmy')
      .then((res) => res.json())
      .then((res) => console.log('data: ', res[1].node.content.title))
      .then((res) => setData(res));
    console.log('effect ended');
  }, []);

  return (
    <div className="home">
      {[1, 2, 3, 4, 5].map((i) => {
        return (
          <Item key={i} texto="texto">
            {[1, 2, 3, 4, 5, 6, 7, 8, 9].map((i) => {
              return (
                <CardComp
                  key={i}
                  cardText="Descripcion"
                  cardTitle={data[1].node.content.title}
                  cardSubTitle="Subtitulo"
                  cardImg="https://placedog.net/300/250"
                ></CardComp>
              );
            })}
          </Item>
        );
      })}
    </div>
  );
};
